import React from 'react';
import { bool, func } from 'prop-types';

const Burger = ({ open:boolean, setOpen, ...props }) => {

  const isExpanded = open ? true : false;

  return (
    <div className="burger" aria-label="Toggle menu" aria-expanded={isExpanded} open={open} onClick={() => setOpen(!open)} {...props}>
      <span />
      <span />
      <span />
    </div>
  )
}

Burger.propTypes = {
  open: bool.isRequired,
  setOpen: func.isRequired,
};

export default Burger;
